import Axios from 'axios'

async function getApi(){
    let data;
    let html = [];
    try {
        const response = await Axios.get("/test");
        data = response.data.rows;
    } catch (err){
        console.log(err);
    }
    data.forEach(element => {
        let para = ""
        element.forEach(col => {
            para += (col)+", ";
        })
        html.push(para);
    });
    return (html);

}

